      {"377670e2-312e-4be4-b46a-d44bb251a374":{"version":"3.8.2","title":"Bokeh Application","config":{"type":"object","name":"DocumentConfig","id":"p1555","attributes":{"notifications":{"type":"object","name":"Notifications","id":"p1556"}}},"roots":[{"type":"object","name":"Column","id":"p1554","attributes":{"children":[{"type":"object","name":"Row","id":"p1552","attributes":{"children":[{"type":"object","name":"Div","id":"p1551","attributes":{"width":700,"text":"\n&lt;h1&gt;Ejemplo b\u00e1sico de plot \u2192 variante \"dataicann\"&lt;/h1&gt;\n&lt;h4&gt;Ignacio D\u00edaz Blanco, 2021. Universidad de Oviedo&lt;/h4&gt;\n&lt;b&gt;Uso de fuentes de datos (source)&lt;/b&gt;\n&lt;table&gt;\n&lt;td valign=\"top\"&gt;\n&lt;p&gt;En este ejemplo, utilizamos una fuente de datos\nmediante el objeto &lt;i&gt;source&lt;/i&gt;. El objeto &lt;i&gt;source&lt;/i&gt; puede verse como una tabla \nen este caso, tiene &lt;i&gt;N&lt;/i&gt; muestras y atributos &lt;i&gt;'t', 'ax', 'ay','ir','is'&lt;/i&gt;\n&lt;/p&gt;\n&lt;p&gt;Este objeto es una \"fuente de datos\" com\u00fan\nque \"sincroniza\" todas las figuras\ncualquier cambio en los datos (modificaci\u00f3n, selecci\u00f3n)\nes inmediatamente actualizado por Boheh en \ntodas las figuras que tengan esa fuente&lt;/p&gt;\n&lt;/td&gt;\n\n&lt;td valign=\"top\"&gt;\n&lt;p&gt;Prueba a seleccionar una parte en una de las figuras. \nVer\u00e1s que en el resto de las figuras quedan los elementos \nseleccionados consistentemente. Esto se llama en interacci\u00f3n \"linking\"&lt;/p&gt;\t\n&lt;/td&gt;\n&lt;/table&gt;\n&lt;a href=\"fuentes/demo1e_plot_basico_source_dataicann_codigofuente.html\"&gt;(c\u00f3digo fuente)&lt;/a&gt;"}}]}},{"type":"object","name":"Row","id":"p1553","attributes":{"children":[{"type":"object","name":"Figure","id":"p1423","attributes":{"width":300,"height":300,"x_range":{"type":"object","name":"DataRange1d","id":"p1424"},"y_range":{"type":"object","name":"DataRange1d","id":"p1425"},"x_scale":{"type":"object","name":"Linear
